import React from 'react';

const Footer = () => {
    return (
    <footer>
        <div className="pie">
            <div className="contactanos">
                <h4>Contactanos: gymbob@gmail.com</h4>
            </div>
            <div className="numero">
                <h4>Numero: 987654321</h4>
            </div>
        </div>
    </footer>
);
};

export default Footer;
